__NUXT_JSONP__("/nuestros-trabajos/G5pbvq36dkmvORJ71cPw", (function(a,b){return {data:[{headingText:"La Boda de Sara y Toni",mainText:"\u003Cp\u003EFrescura, colores de primavera y aire es lo que caracteriza tanto la personalidad de Sara y Toni como su boda. Su invitación no podría ser si no con un aire joven y desenfadado y ese toque de ensueño que la hace especial.&nbsp;\u003C\u002Fp\u003E\n\u003Cp\u003E&nbsp;&nbsp;&nbsp;\u003C\u002Fp\u003E\n\u003Cp\u003ELa impresión está hecha en un papel de alta calidad de grano satinado que permite un acabado preciso y unos colores muy vivos. Sin salirnos de esa línea natural y de ensueño, combinamos la invitación con un sobre hecho en papel vegetal que deja entrever sutilmente los detalles de una invitación tan única que, además, también es un recuerdo para sus invitados con un retrato de la enamorada pareja.\u003C\u002Fp\u003E\n",imgSrc:a,thumbnailArray:[a,"https:\u002F\u002Ffirebasestorage.googleapis.com\u002Fv0\u002Fb\u002Fartenupcia.appspot.com\u002Fo\u002Fflamelink%2Fmedia%2Fsized%2F900_9999_100%2FIMG_4963.jpg?alt=media&token=9b6f48bf-0543-4b8e-a043-1e62ec756ce8","https:\u002F\u002Ffirebasestorage.googleapis.com\u002Fv0\u002Fb\u002Fartenupcia.appspot.com\u002Fo\u002Fflamelink%2Fmedia%2Fsized%2F900_9999_100%2FIMG_4964.jpg?alt=media&token=826b446f-5c8b-4e30-bd41-580e7bd1b611",b,b],badgeItems:[]}],fetch:[],mutations:void 0}}("https:\u002F\u002Ffirebasestorage.googleapis.com\u002Fv0\u002Fb\u002Fartenupcia.appspot.com\u002Fo\u002Fflamelink%2Fmedia%2Fsized%2F900_9999_100%2FIMG_4961.jpg?alt=media&token=ef41abd7-3304-49f5-829a-a5073bd13d32","")));